import React, { Component } from "react";
import "./body.css";
import ssi from "./pics/ssi.jpg";
class Body extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div class="container">
        <div class="row ar1">
          <div class="col-sm-6">
            <h2>SSI - Safe Solutions International</h2>
            <p>
              Delivering best quality Training and provide Consultancy services
              in Quality, Health, Safety & Environment.
            </p>
          </div>
          <div class="col-sm-6">
            <img src={ssi} alt="ssi img" />
          </div>
        </div>
      </div>
    );
  }
}

export default Body;
